Installation, 3D, video, sound11.14. 2019&nbsp; &nbsp; &nbsp;The age of Anthropocene sees the onset of societal and environmental disaster, stemming from human involvement via imperialism, industrialism, globalization and capitalism. Intricately fabricated rules on how identities are expected to be played has created unique social illnesses and caused potentially irreversible damage to the world, both to the earth itself and to people. The sound in this piece is databent essays relevant to recognizing and seeing a way out, including works by bell hooks, Susan Sontag, José Esteban Muñoz and Umair Haque. Additional clip in video projections of the kiki demonstration provided by Elie Liakopoulos&nbsp;
